/*-- dependencies --*/
import './App.css';
import { React , useState } from 'react';
import {BrowserRouter, Route, Routes} from 'react-router-dom';
/*-- components --*/
import Header from './components/Header/Header.js'
import Footer from './components/Footer/Footer.js'
/*-- pages --*/
import Home from './pages/HomePage/HomePage.js'
import SignUp from './pages/SignUp/SignUp.js'
import LogIn from './pages/LogIn/LogIn.js'
import ConfirmUser from './pages/ConfirmUser/ConfirmUser.js'
import HowToBuy from './pages/HowToBuy/HowToBuy';
import HowToSell from './pages/HowToSell/HowToSell';
import FAQ from './pages/FAQ/FAQ';
import Bid from './pages/Bid/Bid.js'
import Transaction from './pages/Transaction/Transaction';

function App() {


  return (
    <div>
      <BrowserRouter>
        <Header />
        <Routes>
            <Route path="/" element={<Home/>} />
            <Route path="/signup" element={<SignUp/>} />
            <Route path="/login" element={<LogIn />} />
            <Route path="/userconfirmation" element={<ConfirmUser />} />
            <Route path="/howtobuy" element={<HowToBuy />} />
            <Route path="/howtosell" element={<HowToSell/>}/>
            <Route path="/faq" element={<FAQ/>}/>
            <Route path="/bid" element={<Bid />} />
            <Route path="/transaction" element={<Transaction />} />
        </Routes>
        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
